import React from "react";
// eslint-disable-next-line
const Footer = () => (
  <div className="footer">
    <p align="center">പി എസ് സി വിദ്യാർത്ഥികൾക്ക് വേണ്ടി തയ്യാറാക്കിയ ആപ്പ്ളിക്കേഷൻ ❤️</p>
  </div>
);

export default Footer;
